import React from "react";
import Homeproductslider from "./Homeproductslider";
import Homeslider from "./Homeslider";
import Homemain from "./Homemain";

const Home = () => {
  return (
    <React.Fragment>
      <Homehero />
      <Homemain />
      <Homeproductslider />
    </React.Fragment>
  );
};
export default Home;
